import React, { Component } from 'react'
import css from './ProfileBG.module.css';
import bg from '../../../img/friends_bg1.png';

export default class BG extends Component {
    render() {
        return (
            <div>
                <img src={bg} className={css.bg}/>
            </div>
        )
    }
}
